# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - django.http.request.HttpRequest~Subclass
    - wagtailcache
    - Member[cache].Member[WSGIRequest]
  - - django.http.response.HttpResponse~Subclass
    - wagtailcache
    - Member[cache].Member[HttpResponse]
  - - django.http.response.HttpResponse~Subclass
    - wagtailcache
    - Member[cache].Member[SimpleTemplateResponse]
